import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class Navbar extends Component {
  render() {
    return (
    <div className="topnav">
      <h1 className="header-text">Alec Livinghouse</h1>
    </div>
    );
  }
}

export default Navbar;
